# Basic security settings
toggle 1
enable-remote-toggle 0
enable-remote-http-toggle 0
enable-edit-actions 0

# Filtering
filterfile default.filter
filterfile user.filter

# Actions
# actionsfile match-all.action
# actionsfile default.action
# actionsfile user.action

# Buffering
buffer-limit 4096

# Headers for anonymity
# hide-forwarded-for-headers 1
# hide-from-header 1
# hide-referrer remove-referer
# hide-user-agent Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36

# Compression
compression-level 1

# Temporary directory
temporary-directory /tmp

# Allow local connections
permit-access 127.0.0.1

# Minimal logging for performance
debug 1024

# Forward rules: Each Privoxy port forwards to corresponding Tor SOCKS port
# Pattern: Privoxy 2000X -> Tor SOCKS 1000X

